import React from 'react';
import './Projects.css';

import projects from './projects.json';
import orderbud from '../../assets/orderbud.png';
import flashback from '../../assets/flashback.png';

const Projects = () => {

    const images = [orderbud, flashback]

    return (
        <div className="projects-section-main-container">
            <div className="projects-section-container">
                <div className="projects-header">
                    <div className="header-underline" />
                    <h1>Featured Projects</h1>
                    <p>I love building cool things to learn new technologies and create solutions to problems I experience. Here are some of my most recent projects.</p>
                </div>
                <div className="project-container">
                    {
                        projects.map(project => {
                            return (
                                <div className="project">
                                    <div className="image-container">
                                        <img className={project.id === 1 ? "mobile-project-image" : "project-image"} src={images[project.id - 1]} alt={project.title} />
                                    </div>
                                    <div className="project-details">
                                        <p className="project-title">{project.name}</p>
                                        <p className="project-subtitle">{project.subtitle}</p>
                                        <p className="description">{project.description}</p>
                                        <div className="technologies-container">
                                            {
                                                project.technologies.map(technology => {
                                                    return (
                                                        <div className="technologies">
                                                            <p>{technology}</p>
                                                        </div>
                                                    )
                                                })
                                            }
                                        </div>
                                    </div>
                                </div>
                            )
                        })
                    }
                </div>
            </div>
        </div>
    )
}

export default Projects;
